import logo from '../logo.png';
import history from '../History';
import Nav from './Nav.js';


class App extends Component {
  render() {
    return (
      <div className="Home">
        <div className="lander">
          <h1>Data sharing platform</h1>
          <Nav/>
        </div>
      </div>
    );
  }
}

export default App;
